// Home.js
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="dark:bg-theme-dark-background text-theme-light-text dark:text-theme-dark-text h-screen w-full ">
        <div className="text-4xl font-bold pt-12 pl-12">Home</div>
        <div className="grid grid-cols-4 gap-4 w-full h-full pt-16 pb-16 pr-12 pl-12 ">
            <div className="col-span-1 flex flex-col justify-center items-center bg-gray-200 dark:bg-gray-700 p-4 rounded-lg border border-white">
                <Link to="/techniques" className="text-xl font-bold">Techniques</Link>
            </div>
            <div className="col-span-1 flex flex-col justify-center items-center bg-gray-200 dark:bg-gray-700 p-4 rounded-lg border border-white">
                <Link to="/materials" className="text-xl font-bold">Materials</Link>
            </div>
            <div className="col-span-1 flex flex-col justify-center items-center bg-gray-200 dark:bg-gray-700 p-4 rounded-lg border border-white">
                <Link to="/interest-board" className="text-xl font-bold">Interest Board</Link>
            </div>
            <div className="col-span-1 flex flex-col justify-center items-center bg-gray-200 dark:bg-gray-700 p-4 rounded-lg border border-white">
                <Link to="/project-history" className="text-xl font-bold">Project History</Link>
            </div>
        </div>
    </div>
  );
};

export default Home;
